import React from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from './components/Home';

function App() {
  return (
    <div>
      I am from App JS
      <Router>
          <Switch>
              <Route exact path='/home' component={Home}></Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
